00 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:758:\"<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:10:\"field_tags\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:3:\"tid\";s:1:\"6\";}}}s:11:\"field_image\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"14\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:14:\"page2-img3.jpg\";s:3:\"uri\";s:35:\"public://field/image/page2-img3.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:5:\"14777\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1409733582\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:10:\"TFSC BMSIT\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"200\";s:6:\"height\";s:3:\"194\";}}}s:9:\"field_url\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:18:\"http://lipsum.com/\";s:6:\"format\";N;s:10:\"safe_value\";s:18:\"http://lipsum.com/\";}}}}',0,1410118203,1),('field:node:15','a:4:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1654:\"    After the camp, the volunteers of Fsmk decided to make the Bmsit Glug more active from this sem and spread about the Free Software to more people out there. The Free Software Club (TFSC), also known as the GNU/Linux Users Group (GLUG), is a student club of technology and FOSS enthusiasts in BMSIT. As the name of the club implies, we are huge fans of Free and Open Source Software (FOSS), and one of the main objectives of this club will be to promote free software among its members, the college, and the world in general.  We started off by setting up a stall  for enrolling students for the glug sessions held every week in college. A few of them did enroll, now our next task was to decide the topic on which we had to carry out our session on, and we thought Java Script basics would do. Thirty students from various batches where present, and Kishan handled this session, and he started off by talking about the importance of free software and the association of glug of various colleges with the Free Software Movement Karnataka, and how the interested ones could enroll for it and also attend the sunday schools held by this association. Then he started with the Html and Java script  basics and  how the Java scripts could be used within an Html document , all this was done in the seminar hall and it was an theory session, however people who had got their laptops along, tried out all the things taught side by side. Here is a link from where you can learn the Html and JS Basics from : https://www.youtube.com/watch?v=3JluqTojuME. \"You never know unless you try\" . So do try  to explore about these new stuff, thats how we learn better. \";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1715:\"<p>After the camp, the volunteers of Fsmk decided to make the Bmsit Glug more active from this sem and spread about the Free Software to more people out there. The Free Software Club (TFSC), also known as the GNU/Linux Users Group (GLUG), is a student club of technology and FOSS enthusiasts in BMSIT. As the name of the club implies, we are huge fans of Free and Open Source Software (FOSS), and one of the main objectives of this club will be to promote free software among its members, the college, and the world in general.  We started off by setting up a stall  for enrolling students for the glug sessions held every week in college. A few of them did enroll, now our next task was to decide the topic on which we had to carry out our session on, and we thought Java Script basics would do. Thirty students from various batches where present, and Kishan handled this session, and he started off by talking about the importance of free software and the association of glug of various colleges with the Free Software Movement Karnataka, and how the interested ones could enroll for it and also attend the sunday schools held by this association. Then he started with the Html and Java script  basics and  how the Java scripts could be used within an Html document , all this was done in the seminar hall and it was an theory session, however people who had got their laptops along, tried out all the things taught side by side. Here is a link from where you can learn the Html and JS Basics from : <a href=\"https://www.youtube.com/watch?v=3JluqTojuME\">https://www.youtube.com/watch?v=3JluqTojuME</a>. \"You never know unless you try\" . So do try  to explore about these new stuff, thats how we learn better.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:10:\"field_tags\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:3:\"tid\";s:1:\"7\";}}}s:11:\"field_image\";a:0:{}s:9:\"field_url\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:38:\"http://swathiraotfscbmsit.blogspot.in/\";s:6:\"format\";N;s:10:\"safe_value\";s:38:\"http://swathiraotfscbmsit.blogspot.in/\";}}}}',0,1410118203,1),('field:node:16','a:4:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:631:\"Its been a year since we started our college glug called GLUE(GECH Linux Users Enthusiasts),and every saturday we conduct the  GLUE sessions of 3 hours.And in the previous session we involved the juniours(2nd year students).The strenght of the juniours and their interest shown by them were overwhelming.\r\n\r\n     The first hour of the session was conducted by POOJA (one of the GLUE core member) on the introduction about Qt(Quick Trip) and the history of the GUI(Graphical User Interface).Qt session  was taken for the 3rd and 4th year GLUE members.The 2nd year students joined the session for last 2 hours.\r\n\r\nIMG_20140816_153759\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:647:\"<p>Its been a year since we started our college glug called GLUE(GECH Linux Users Enthusiasts),and every saturday we conduct the  GLUE sessions of 3 hours.And in the previous session we involved the juniours(2nd year students).The strenght of the juniours and their interest shown by them were overwhelming.</p>\n<p>     The first hour of the session was conducted by POOJA (one of the GLUE core member) on the introduction about Qt(Quick Trip) and the history of the GUI(Graphical User Interface).Qt session  was taken for the 3rd and 4th year GLUE members.The 2nd year students joined the session for last 2 hours.</p>\n<p>IMG_20140816_153759</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:10:\"field_tags\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:3:\"tid\";s:1:\"7\";}}}s:11:\"field_image\";a:0:{}s:9:\"field_url\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:74:\"https://colourfulllrainbow.wordpress.com/2014/08/18/glue-session-16082014/\";s:6:\"format\";N;s:10:\"safe_value\";s:74:\"https://colourfulllrainbow.wordpress.com/2014/08/18/glue-session-16082014/\";}}}}',0,1410118203,1),('field:node:17','a:4:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2780:\"\r\n\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum maximus consequat leo vitae gravida. Pellentesque dignissim enim lorem, ut condimentum lorem tristique et. Aenean ultrices mi vitae ligula pretium pulvinar. Nam libero