, comes from a line in section 1.10.32.','','filtered_html'),('node','fsmk_glugs',0,13,13,'und',0,'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.','','filtered_html'),('node','fsmk_glugs',0,14,14,'und',0,'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.','','filtered_html'),('node','fsmk_glugs',0,15,15,'und',0,'    After the camp, the volunteers of Fsmk decided to make the Bmsit Glug more active from this sem and spread about the Free Software to more people out there. The Free Software Club (TFSC), also known as the GNU/Linux Users Group (GLUG), is a student club of technology and FOSS enthusiasts in BMSIT. As the name of the club implies, we are huge fans of Free and Open Source Software (FOSS), and one of the main objectives of this club will be to promote free software among its members, the college, and the world in general.  We started off by setting up a stall  for enrolling students for the glug sessions held every week in college. A few of them did enroll, now our next task was to decide the topic on which we had to carry out our session on, and we thought Java Script basics would do. Thirty students from various batches where present, and Kishan handled this session, and he started off by talking about the importance of free software and the association of glug of various colleges with the Free Software Movement Karnataka, and how the interested ones could enroll for it and also attend the sunday schools held by this association. Then he started with the Html and Java script  basics and  how the Java scripts could be used within an Html document , all this was done in the seminar hall and it was an theory session, however people who had got their laptops along, tried out all the things taught side by side. Here is a link from where you can learn the Html and JS Basics from : https://www.youtube.com/watch?v=3JluqTojuME. \"You never know unless you try\" . So do try  to explore about these new stuff, thats how we learn better. ','','filtered_html'),('node','fsmk_glugs',0,16,16,'und',0,'Its been a year since we started our college glug called GLUE(GECH Linux Users Enthusiasts),and every saturday we conduct the  GLUE sessions of 3 hours.And in the previous session we involved the juniours(2nd year students).The strenght of the juniours and their interest shown by them were overwhelming.\r\n\r\n     The first hour of the session was conducted by POOJA (one of the GLUE core member) on the introduction about Qt(Quick Trip) and the history of the GUI(Graphical User Interface).Qt session  was taken for the 3rd and 4th year GLUE 