INSERT INTO `field_revision_body` VALUES ('node','fsmk_homepage',0,1,1,'und',0,'Interdum et malesuada fames ac ante ipsum primis in faucibus. Pellentesque ultrices justo elit, quis tristique enim vestibulum et. Cras pulvinar fermentum justo, eget lobortis velit. Quisque imperdiet massa metus, eu ultrices nisl tincidunt non. Sed eget dolor id metus tristique efficitur eu vel ','','filtered_html'),('node','fsmk_homepage',0,3,3,'und',0,'IIt is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).','','filtered_html'),('node','fsmk_homepage',0,4,4,'und',0,'Ornare nulla proin odio consequat sapien vestibulum ipsum primis sed amet consequat lorem dolore. Ornare nulla proin odio consequat sapien vestibulum ipsum primis sed amet consequat lorem dolore','','filtered_html'),('node','fsmk_homepage',0,5,5,'und',0,'Ornare nulla proin odio consequat sapien vestibulum ipsum primis sed amet consequat lorem dolore. Ornare nulla proin odio consequat sapien vestibulum ipsum primis sed amet consequat lorem dolore ','','filtered_html'),('node','fsmk_homepage',0,6,6,'und',0,'Ornare nulla proin odio consequat sapien vestibulum ipsum primis sed amet consequat lorem dolore. Ornare nulla proin odio consequat sapien vestibulum ipsum primis sed amet consequat lorem dolore ','','filtered_html'),('node','fsmk_homepage',0,7,7,'und',0,'Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore.','','filtered_html'),('node','fsmk_homepage',0,8,8,'und',0,'Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore.','','filtered_html'),('node','fsmk_homepage',0,9,9,'und',0,'Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore.','','filtered_html'),('node','fsmk_homepage',0,10,10,'und',0,'Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore.','','filtered_html'),('node','fsmk_glugs',0,11,11,'und',0,'FSMK is a registered not-for-profit organization whose primary objective is to spread and create awareness about free software technologies amongst different sections of the society. FSMK is driven by volunteers from various backgrounds like software professionals, government officials, academicians and students. The Students Chapter of FSMK works actively with college students and encourages them not only to use free software but also contribute to the development of various free software. We facilitate formation of college-wise units called GNU/Linux User\'s Group (GLUG) which conduct various technical sessions regularly throughout the academic session.','','filtered_html'),('node','fsmk_glugs',0,12,12,'und',0,'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.','','filtered_html'),('node','fsmk_glugs',0,13,13,'und',0,'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.','','filtered_html'),('node','fsmk_glugs',0,14,14,'und',0,'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.','','filtered_html'),('node','fsmk_glugs',0,15,15,'und',0,'    After the camp, the volunteers of Fsmk decided to make the Bmsit Glug more active from this sem and spread about the Free Software to more people out there. The Free Software Club (TFSC), also known as the GNU/Linux Users Group (GLUG), is a student club of technology and FOSS enthusiasts in BMSIT. As the name of the club implies, we are huge fans of Free and Open Source Software (FOSS), and one of the main objectives of this club will be to promote free software among its members, the college, and the world in general.  We started off by setting up a stall  for enrolling students for the glug sessions held every week in college. A few of them did enroll, now our next task was to decide the topic on which we had to carry out our session on, and we thought Java Script basics would do. Thirty students from various batches where present, and Kishan handled this session, and he started off by talking about the importance of free software and the association of glug of various colleges with the Free Software Movement Karnataka, and how the interested ones could enroll for it and also attend the sunday schools held by this association. Then he started with the Html and Java script  basics and  how the Java scripts could be used within an Html document , all this was done in the seminar hall and it was an theory session, however people who had got their laptops along, tried out all the things taught side by side. Here is a link from where you can learn the Html and JS Basics from : https://www.youtube.com/watch?v=3JluqTojuME. \"You never know unless you try\" . So do try  to explore about these new stuff, thats how we learn better. ','','filtered_html'),('node','fsmk_glugs',0,16,16,'und',0,'Its been a year since we started our college glug called GLUE(GECH Linux Users Enthusiasts),and every saturday we conduct the  GLUE sessions of 3 hours.And in the previous session we involved the juniours(2nd year students).The strenght of the juniours and their interest shown by them were overwhelming.\r\n\r\n     The first hour of the session was conducted by POOJA (one of the GLUE core member) on the introduction about Qt(Quick Trip) and the history of the GUI(Graphical User Interface).Qt session  was taken for the 3rd and 4th year GLUE members.The 2nd year students joined the session for last 2 hours.\r\n\r\nIMG_20140816_153759','','filtered_html'),('node','fsmk_cc',0,17,17,'und',0,'\r\n\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum maximus consequat leo vitae gravida. Pellentesque dignissim enim lorem, ut condimentum lorem tristique et. Aenean ultrices mi vitae ligula pretium pulvinar. Nam libero leo, fermentum laoreet sagittis vel, faucibus nec nulla. Suspendisse ut nisl sed ipsum dignissim egestas in ac velit. Phasellus iaculis finibus ex, eget rutrum tortor mollis nec. Suspendisse potenti. Nunc vitae hendrerit eros. Proin nec lorem enim. Donec eget sollicitudin metus, at interdum neque. Sed condimentum lectus eget orci porttitor consequat. Ut interdum, ligula nec pharetra congue, tellus erat viverra ante, et hendrerit risus justo at nunc. In accumsan felis magna, vitae venenatis elit luctus sit amet. Mauris erat leo, condimentum quis diam id, hendrerit fringilla massa.\r\n\r\nAenean dignissim ipsum massa. Nulla consequat elementum magna et ultricies. Fusce venenatis tortor ut egestas maximus. Nullam a mollis ante. Etiam molestie aliquet tristique. Nam non nulla sed dolor maximus dapibus. Donec mauris nunc, imperdiet sed dui in, dictum consequat leo. Donec et turpis diam. Fusce ex velit, mattis eget ligula vulputate, scelerisque mollis mi. Curabitur auctor feugiat luctus.\r\n\r\nSed accumsan, ligula ac lobortis mollis, odio dolor porttitor sapien, id pretium sem ligula non diam. Sed egestas molestie orci sit amet dapibus. Vestibulum posuere id augue ut mattis. Nunc nisl lorem, auctor a arcu eget, ultrices maximus nulla. Aliquam cursus eu ex non feugiat. Proin faucibus tristique lacus luctus vehicula. Quisque nisi augue, finibus vel nibh sed, dapibus laoreet lacus. Fusce sapien felis, convallis sed tortor quis, interdum egestas magna. Nulla id mauris sapien. Curabitur sit amet nibh ac tortor euismod tempus.\r\n\r\nNulla facilisi. Aliquam erat volutpat. Praesent tempo