 vel illum dolore projects ',0),(10,'node',' project1 duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat vel illum dolore projects ',0),(11,'node',' about glugs fsmk is a registered notforprofit organization whose primary objective is to spread and create awareness about free software technologies amongst different sections of the society fsmk is driven by volunteers from various backgrounds like software professionals government officials academicians and students the students chapter of fsmk works actively with college students and encourages them not only to use free software but also contribute to the development of various free software we facilitate formation of collegewise units called gnu linux user s group glug which conduct various technical sessions regularly throughout the academic session about glugs ',0),(12,'node',' glugdsce contrary to popular belief lorem ipsum is not simply random text it has roots in a piece of classical latin literature from 45 bc making it over 2000 years old richard mcclintock a latin professor at hampdensydney college in virginia looked up one of the more obscure latin words consectetur from a lorem ipsum passage and going through the cites of the word in classical literature discovered the undoubtable source lorem ipsum comes from sections 11032 and 11033 of de finibus bonorum et malorum the extremes of good and evil by cicero written in 45 bc this book is a treatise on the theory of ethics very popular during the renaissance the first line of lorem ipsum lorem ipsum dolor sit amet comes from a line in section 11032 glugs ',0),(13,'node',' toggle contrary to popular belief lorem ipsum is not simply random text it has roots in a piece of classical latin literature from 45 bc making it over 2000 years old richard mcclintock a latin professor at hampdensydney college in virginia looked up one of the more obscure latin words consectetur from a lorem ipsum passage and going through the cites of the word in classical literature discovered the undoubtable source lorem ipsum comes from sections 11032 and 11033 of de finibus bonorum et malorum the extremes of good and evil by cicero written in 45 bc this book is a treatise on the theory of ethics very popular during the renaissance the first line of lorem ipsum lorem ipsum dolor sit amet comes from a line in section 11032 glugs http ksspin  ',0),(14,'node',' tfsc bmsit there are many variations of passages of lorem ipsum available but the majority have suffered alteration in some form by injected humour or randomised words which don t look even slightly believable if you are going to use a passage of lorem ipsum you need to be sure there isn t anything embarrassing hidden in the middle of text all the lorem ipsum generators on the internet tend to repeat predefined chunks as necessary making this the first true generator on the internet it uses a dictionary of over 200 latin words combined with a handful of model sentence structures to generate lorem ipsum which looks reasonable the generated lorem ipsum is therefore always free from repetition injected humour or noncharacteristic words etc glugs http lipsumcom  ',0),(15,'node',' first session of the free software club  after the camp the volunteers of fsmk decided to make the bmsit glug more active from this sem and spread about the free software to more people out there the free software club tfsc also known as the gnu linux users group glug is a student club of technology and foss enthusiasts in bmsit as the name of the club implies we are huge fans of free and open source software foss and one of the main objectives of this club will be to promote free software among its members the college and the world in general we started off by setting up a stall for enrolling students for the glug sessions held every week in college a few of them did enroll now our next task was to decide the topic on which we had to carry out our session on and we thought java script basics would do thirty students from various batches where present and kishan handled this session and he started off by talking about the importance of free software and the association of glug of various colleges with the free software movement karnataka and how the interested ones could enroll for it and also attend the sunday schools held by this association then he started with the html and java script basics and how the java scripts could be used within an html document all this was done in the seminar hall and it was an theory session however people who had got their laptops along tried out all the things taught side by side here is a link from where you can learn the html and js basics from  https wwwyoutubecom watch v 3jluqtojume  you never know unless you try so do try to explore about these new stuff thats how we learn better glug news http swathiraotfscbmsitblogspotin  ',0),(16,'node',' glue session its been a year since we started our college glug called glue gech linux users enthusiasts and every saturday we conduct the glue sessions of 3 hoursand in the previous session we involved the juniours 2nd year students the strenght of the juniours and their interest shown by them were overwhelming the first hour of the session was conducted by pooja one of the glue core member on the introduction about qt quick trip and the history of the gui graphical user interface qt session was taken for the 3rd and 4th year glue membersthe 2nd year students joined the session for last 2 hours img20140816153759 glug news https colourfulllrainbowwordpresscom 20140818 gluesession16082014  ',0),(17,'node',' about community center lorem ipsum dolor sit amet consectetur adipiscing elit vestibulum maximus consequat leo vitae gravida pellentesque dignissim enim lorem ut condimentum lorem tristique et aenean ultrices mi vitae ligula pretium pulvinar nam libero leo fermentum laoreet sagittis vel faucibus nec nulla suspendisse ut nisl sed ipsum dignissim egestas in ac velit pha